const express = require('express');
const dbC = require('./dbConfig');

const app = express();
const port = 3000;

app.use(express.json()); // Add this line to parse incoming JSON data

app.post('/button-click', async (req, res) => {
  try {
    const { game1, game2, game3, game4, game5 } = req.body;
    console.log(game1, game2, game3, game4, game5);
    res.send('Success');
  } catch (error) {
    console.error(error);
    res.status(500).send('Internal server error');
  }
});

  
app.listen(port, () => {
    console.log(`Server listening on port ${port}`);
});
